και μπορεί να συνεχιστεί για δέκα είκοσι χρόνια νομίζω ότι αυτό είναι λίγο γελοίο Δικαιούμαστε να πούμε ότι "Διαρκεί μόνο μία εβδομάδα."; Ναι, όχι, ή ίσως;
Οχι

Ο Δρ.Richards δεν παύει ποτέ να μας εκπλήσσει. Δικαιούμαστε να πούμε ότι "Συνεχώς μας εκπλήσσει ο Δρ. Richards."; Ναι, όχι, ή ίσως;
Ναί

Δεν πήγε να πάει. Δικαιούμαστε να πούμε ότι "Ήταν ο πρώτος που είχε προσκληθεί και απολάμβανε την εμπειρία."; Ναι, όχι, ή ίσως;
Οχι

Ο ίδιος αντίκρισε τον εαυτό του να είναι ο σκύλος στο μύθο που είχε πέσει την ουσία να αρπάζει σε μια παραληρητική σκιά. Δικαιούμαστε να πούμε ότι "Ο θρύλος είναι τόσο παλιός όσο και ο χρόνος."; Ναι, όχι, ή ίσως;
Μπορεί

Τα αρχεία υποθέσεων θα πρέπει να αντιγράφονται και να παρέχονται στον πελάτη. Δικαιούμαστε να πούμε ότι "Ο πελάτης θα είναι εφοδιασμένος με αρχεία υπόθεσεων."; Ναι, όχι, ή ίσως;
Ναί

Ένας διάσημος υποστηρικτής της Μεξικανικής Ισπανικής λαογραφίας στα Νοτιοδυτικά και την Καλιφόρνια ήταν ο Charles F. Lummis (1859-1928), ένας αυτοδίδακτος φωτογράφος, εθνολόγος, μουσικολόγος, δημοσιογράφος και ιδρυτής του Νοτιοδυτικού Μουσείου στο Λος Άντζελες. Δικαιούμαστε να πούμε ότι "Ο Charles F. Lummis ήταν φωτογράφος."; Ναι, όχι, ή ίσως;
Ναί

Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Δικαιούμαστε να πούμε ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
